const UPDATE_MESSAGE_TEXT = "UPDATE_MESSAGE_TEXT";
const SEND_MESSAGE = "SEND_MESSAGE";

const initialState = {
  namesData: [
    {
      name: 'Ernest',
      id: '1',
      img: "data:image/jpeg;base64,"
    },
    {
      name: 'Maris',
      id: '2',
      img: "data:image/jpeg;base64,"
    },
    {
      name: 'Angelina',
      id: '3',
      img: "data:image/jpeg;base64,"
    },
    {
      name: 'Alla',
      id: '4',
      img: "data:image/jpeg;base64,"
    },
    {
      name: 'Edward',
      id: '5',
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRo4zGSr25cTfr__JnNBlxju18g9geM7uir_g&usqp=CAU"
    }
  ],

  messagesData: [
    {message: 'Hello, how r u?'},
    {message: 'Looser'},
    {message: 'Shut up'},
  ],

  newMessageText: '',
};

export const dialogsReducer = (state=initialState, action) => {
  switch (action.type) {
    case UPDATE_MESSAGE_TEXT:
      state.newMessageText = action.dialogText;
      return state;
    case SEND_MESSAGE:
      const body = state.newMessageText;
      state.newMessageText = '';
      state.messagesData.push(
        {
          id: 6,
          message: body,
        }
      );
      return state;
    default:
      return state;
  };
};

export const updateMessageTextAC = (text) => {
  return {
    type: UPDATE_MESSAGE_TEXT,
    dialogText: text,
  };
};

export const sendMessageCreator = () => ({type: SEND_MESSAGE});
